import React from "react";
import '../css/Home.css';

function Home() {
  return (
    <div className="home p-4">
        <span>BEN CRUISE</span>
        <span>WEB DEVELOPER </span>
        <span>AND DESIGNER</span>
        <p>User-Focused Designer with advanced skills in React, Javascript, HTML and CSS, amongst other languages and frameworks.</p>
        <div className="button-div">
          <button className="home-button p-3">PROJECTS</button>
        </div>      
    </div>    
  );
}

export default Home;
